function RecipesItems(props) {
 console.log(props)

    const myItems = [
        {
          id: "01",
          name: "egg",
          descripion: "Rich In Protein",
          link: "#",
        },
        {
          id: "03",
          name: "fish",
          descripion: "Good For Health",
          link: "#",
        },
        {
          id: "02",
          name: "vegitable",
          descripion: "Used in daily life",
          link: "#",
        },
      ];

    //   const filteredData = myItems.filter((foo) => {
    //     //if no input the return the original
    //  return  foo.name = props.food
    // })

   // console.log(filteredData)


      
  return (
    <>
    {myItems.map((item) => {
          return   <div className="container">
                <div class="row">
                    <div class="col-md-3">
                    <div class="card">
                        <div class="card-body">
                          
                      
                           <ul>
                            <li>Name: {item.name} <br/></li>
                            <li>Description: {item.desc}<br/></li>
                            <li> link: {item.link}<br/></li>
                          </ul>
                          
                      {/* Name: {myItems.name} <br/>
                      Description: {myItems.desc}<br/>
                     link: {myItems.link}<br/> */}
                        </div>
                    </div>
                    </div>
                </div>
                </div>
                 })}
    </>
    
  )
}












export default RecipesItems
